import "./Home.css";
import MenuTopRight from "../Menu top-right/MenuTopRight";
import pancake from "../../Images/pancake.jpeg";
import FirstPage from "../First Page/FirstPage";
import LastPage from "../Last Page/LastPage";

function Home() {
  return (
      <>
      <section style={{backgroundColor: "#ECE0DB"}}>
        <FirstPage />
      </section>
      <section style={{padding:"2.5rem"}}>
        {/* <img className="pancake" src={pancake} /> */}
        <MenuTopRight />
      </section>
      <section style={{backgroundColor: "#ECE0DB"}}>
        <LastPage />
      </section>
      </>
  );
}

export default Home;
